const Goo = ({ match }) => {
  const { region } = match.params;
  const { area } = match.params;
  const sum = data[region][area];
  //   const third = data[first];
  //   console.log(third);

  if (!sum) {
    return <div className="yetDev">개발 준비 중입니다.</div>;
  }

  return (
    <>
      {sum.map(value => {
        if (value.area !== undefined) {
          return (
            <div className="GooContainer">
              <Dong area={value.area} dong={value.dong} />
              <Candidates
                src={value.src}
                dangImg={value.dangImg}
                kiho={value.kiho}
                name={value.name}
                introduce={value.introduce}
                desc1={value.desc1}
                desc2={value.desc2}
                desc3={value.desc3}
                key={value.key}
              />
            </div>
          );
        } else {
          return (
            <Candidates
              src={value.src}
              dangImg={value.dangImg}
              kiho={value.kiho}
              name={value.name}
              introduce={value.introduce}
              desc1={value.desc1}
              desc2={value.desc2}
              desc3={value.desc3}
              key={value.key}
            />
          );
        }
      })}
    </>
  );
};

export default Goo;
